import { Link} from "react-router-dom"
import logo from '../assets/LOGO.png'
import '../styles/components-style/Header.css'

function Header(){

    let activeStyle = {
        textDecoration: "underline"
      };
    
      let activeClassName = "underline"

    return (
        <header className='App-header'>
               <img src={logo} alt="kasa-entreprise-location-appartement" className='Logo'/>
               <nav className='App-nav'>
                   <ul className='App-nav'>
                    <li><Link to='/' style={({ isActive }) =>
              isActive ? activeStyle : undefined
            } className="accueil">Accueil</Link></li>                       
                    <li><Link to='/about' style={({ isActive }) =>
              isActive ? activeStyle : undefined
            } className="propos" >A propos</Link></li>
                   </ul>
               </nav>
            </header>
    )
};

export default Header;
